import React, { Component } from "react";

class SideBarItem extends Component {
  
  render() {
    const { project } = this.props;
    return (
            
         <div class="col-2 collapse show d-md-flex bg-light min-vh-100 border border-left-0" id="sidebar">
              <ul class="nav flex-column flex-nowrap overflow-hidden"> 
                  <li class="nav-item">
                      <div class="doc-heading p-3"><span>Document no.{project.documentIdentifier}</span></div>
                        <a class="nav-link collapsed text-truncate" href="#submenu1" data-toggle="collapse" data-target="#submenu1">
                          <span class="d-none d-sm-inline side-nav-title">{project.topic}</span>
                          </a>
                        <div class="collapse " id="submenu1" aria-expanded="false">
                            <ul class="flex-column pl-2 nav">
                                <li class="nav-item">
                                  <a class="active nav-link py-0" href="#">
                                     <span class="side-nav-title topics">{project.subTopic}</span>
                                  </a>
                                </li>
                            </ul>
                        </div>                
                  </li>     
              </ul>
         </div>
    );
  }
}

export default SideBarItem;
